import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

const SidebarNav = styled.nav`
  width: 200px;
  background: #f9f9f9;
  border-right: 1px solid #ddd;
  padding: 20px;
`;

const SidebarLink = styled(Link)`
  display: block;
  padding: 10px;
  text-decoration: none;
  color: #333;

  &:hover {
    background: #e0e0e0;
  }
`;

function Sidebar() {
    return (
        <SidebarNav>
            <h2>ClinicPro</h2>
            <ul>
                <li>
                    <SidebarLink to="/clientes">Clientes</SidebarLink>
                </li>
                <li>
                    <SidebarLink to="/servicos">Serviços</SidebarLink>
                </li>
                <li>
                    <SidebarLink to="/configuracoes">Configurações</SidebarLink>
                </li>
            </ul>
        </SidebarNav>
    );
}

export default Sidebar;
